    let [clicks, setClicks] = useState(0)

    console.log(clicks)

    const aumentar = () => {
        clicks++
        console.log(clicks)
    }

    return (
        <>
            <Boton click={aumentar}>Click me</Boton>
            <p>Clicks: {clicks}</p>

        </>
    )
}
